  return (
    <div style={{padding:'1em',height:'100%',overflowY:'scroll'}}>
        <h1 style={{color:'white'}}>Postings</h1>
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam a eleifend enim. Ut sit amet accumsan ipsum. Nam tristique orci nec leo varius, nec eleifend lectus vulputate. Etiam non vehicula erat. Cras vitae enim eget lorem maximus lacinia. Aliquam quis quam et nisi tincidunt cursus a vitae elit. Phasellus ullamcorper ante nulla, id tincidunt lectus dignissim et. Etiam iaculis, mauris eu fringilla aliquam, nisi tellus elementum lorem, non commodo augue leo eu odio. Curabitur dictum eros sapien. Sed ac metus eget velit feugiat hendrerit id quis libero.</p>
        <div style={{height:'100vh'}}>

        </div>
        <span className='d-flex w-100 justify-content-end position-sticky'>
          <AddPostButton/>
        </span>
    </div>
  );
};

function AddPostButton(){
  return(
    <button className='btn btn-primary'>
      <i class="bi bi-plus-lg"></i>
    </button>
  );
}

export default Postings;
